import SearchBar from "../components/SearchBar";
import Table from "../components/Table";
import { Link } from "react-router-dom";

function TurfSheet() {

    return (
        <>
            <div className="inline-flex items-center">
                <SearchBar />
                <Link to="/scripts/create">
                    <button type="button" className="absolute right-6 text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 text-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">Add Contact</button>
                </Link>
            </div>
            <Table />
        </>
    );
}

export default TurfSheet;
